import React from 'react';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
// import { Nav } from 'react-bootstrap';
// import {NavDropdown} from 'react-bootstrap';
import Dropdown from 'react-bootstrap/Dropdown';

const renderTooltip = props => (
  <div
    {...props}
    style={{
      
      padding: '2px 10px',
      color: 'rgba(0,0,0,.5)',
      borderRadius: 3,
      ...props.style,
    }}
  >
    <Dropdown>
  <Dropdown.Toggle variant="success" id="dropdown-basic">
    Dropdown Button
  </Dropdown.Toggle>

  <Dropdown.Menu>
    <Dropdown.Item href="https://en.wikipedia.org/wiki/Sandalwood">sandalwood</Dropdown.Item>
    <Dropdown.Item href="https://en.wikipedia.org/wiki/Vanilla">vanilla</Dropdown.Item>
    <Dropdown.Item href="https://en.wikipedia.org/wiki/Amber">amber</Dropdown.Item>
  </Dropdown.Menu>
</Dropdown>;
          
    
  
  </div>  
);

const NavDrop = () => (
  <OverlayTrigger
    placement="bottom-start"
    triggerType='focus'
    delay={{ show: 250, hide: 2000 }}
    overlay={renderTooltip}
  >
    <Dropdown.Toggle as={CustomToggle} id="dropdown-custom-components">Custom toggle</Dropdown.Toggle>
  </OverlayTrigger>
);

export default NavDrop;
